DROP TABLE IF EXISTS `procedure`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `procedure` (
  `id` varchar(32) NOT NULL COMMENT '流程编号',
  `pro_id` varchar(32) NOT NULL COMMENT '项目id',
  `name` varchar(64) DEFAULT NULL COMMENT '流程名称\n',
  `process` int(11) DEFAULT '0' COMMENT '流程进度（%）\n',
  `accept` int(11) NOT NULL DEFAULT '1' COMMENT '验证 1.待验证 2.通过 3.不通过（默认1）',
  `status` int(11) DEFAULT '1' COMMENT '状态  1.未启动  2.装修中 3.已完成（默认1）\n',
  `proc_start_time` timestamp NULL DEFAULT NULL COMMENT '计划启动时间\n',
  `proc_end_time` timestamp NULL DEFAULT NULL COMMENT '计划结束时间\n',
  `time_assess` int(11) DEFAULT '0' COMMENT '动态时间评估      +延期 -提前\n',
  `notice` int(11) NOT NULL DEFAULT '2' COMMENT '通知 1.新消息 2.已读消息 ',
  `refuse_msg` varchar(255) DEFAULT NULL COMMENT '不通过的原因',
  `remark` varchar(128) DEFAULT NULL,
  `created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='项目流程';
