DROP TABLE IF EXISTS `progress_record`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `progress_record` (
  `id` varchar(32) NOT NULL COMMENT '编号',
  `prog_id` varchar(32) NOT NULL COMMENT '进度id',
  `prompt_msg` varchar(256) DEFAULT NULL COMMENT '提示信息',
  `prompt_time` timestamp NULL DEFAULT NULL COMMENT '提示时间',
  `prompt_type` int(11) DEFAULT NULL COMMENT '提示类型',
  `reply_content` varchar(256) DEFAULT NULL COMMENT '客户回复内容',
  `reply_time` timestamp NULL DEFAULT NULL COMMENT '回复时间',
  `reply_type` int(11) DEFAULT NULL COMMENT '回复类型    1.手动  2.自动（app设置）\n自动：客户已授权工程进度审核默认为通过，重要变更请直接联系客户',
  `status` int(11) DEFAULT NULL COMMENT '审核状态 1.审核中 2.已通过  3未通过 ',
  `time_assess` int(11) DEFAULT NULL COMMENT '动态时间评估      +延期 -提前',
  `assess_date` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP COMMENT '计划延期/提前完成时间',
  `remark` varchar(128) DEFAULT NULL,
  `created` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='进度记录';
/*!40101 SET character_set_client = @saved_cs_client */;

